import React from "react";
import './Skills.css'

export default class Skills extends React.Component {
    skills = ['Java Script', 'Node js', 'Ajax', 'HTML / CSS', 'GIT', 'Algorithms', 'C++'];
    render() {
        return (
           <div className={'skills'}>
               <h2>Skills</h2>
            <ul>
                {this.skills.map(skill => <li>{skill}</li>)}
            </ul>
           </div>
        )
    }
}
